{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/adriano313/google-da-capstone-2023-bellabeat-ayman-sabek?scriptVersionId=129987997\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"7bcf12d7","metadata":{"papermill":{"duration":0.01296,"end_time":"2023-05-18T00:45:47.932865","exception":false,"start_time":"2023-05-18T00:45:47.919905","status":"completed"},"tags":[]},"source":["**Google Data Analytics Capstone Project 2023 - By Ayman Sabek**\n","# How Can a Wellness Technology Company Play It Smart?\n","\n","**Tools Used: Excel - R -Tableau**"]},{"cell_type":"markdown","id":"de2611a2","metadata":{"papermill":{"duration":0.010317,"end_time":"2023-05-18T00:45:47.953958","exception":false,"start_time":"2023-05-18T00:45:47.943641","status":"completed"},"tags":[]},"source":["**Case Summary:**\n","\n","Bellabeat is a wellness brand for women with an ecosystem of products and services focused on women’s health. The Silicon Valley-based company believes that analyzing smart device fitness data could help unlock new growth opportunities.\n","\n","**Product Focus:**\n","\n","In this analysis, the focus on one of Bellabeat’s products will be on the following:\n","* **Leaf** : Bellabeat’s classic wellness tracker that can be worn as a bracelet, necklace, or clip.\n","The Leaf Tracker connects to the Bellabeat app to track activity, sleep, and stress, so recommendations for the app will be included.\n","* **Bellabeat app** : The Bellabeat app provides users health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users understand their current patterns and make healthy decisions."]},{"cell_type":"markdown","id":"126a93e4","metadata":{"papermill":{"duration":0.010228,"end_time":"2023-05-18T00:45:47.974607","exception":false,"start_time":"2023-05-18T00:45:47.964379","status":"completed"},"tags":[]},"source":["# Ask \n","\n","**Business Task**:\n","* Analyzing intelligent device data to gain insights into how consumers use their smart devices. \n","* Discover the trends in non-Bellabeat devices to help guide the marketing strategy for the company.\n","\n","**Key Stakeholders**:\n","* Urška Sršen: Bellabeat’s co-founder and Chief Creative Officer - Fashion / Entrepreneurship / Women\n","* Sando Mur: Mathematician and Bellabeat’s cofounder - a vital member of the Bellabeat executive team\n","* Bellabeat marketing analytics team"]},{"cell_type":"markdown","id":"8bbc0743","metadata":{"papermill":{"duration":0.010496,"end_time":"2023-05-18T00:45:47.996452","exception":false,"start_time":"2023-05-18T00:45:47.985956","status":"completed"},"tags":[]},"source":["# Prepare\n","\n","Mrs. Sršen encouraged (As Scripted) the use of the public dataset that explores savvy device users’ daily habits. As She points to a specific data set:\n","\n","**Dataset 1**  ● [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) (CC0: Public Domain, dataset made available through [Mobius](https://www.kaggle.com/arashnic))\n","\n","**Dataset 1 Limitation:**\n","* Datasets are outdated with the study done back in 2016\n","* The dataset is limited due to the number of participants (30 FitBit Users) - Yet the Analysis will show the Unique 33 Users included in the dataset. It also doesn’t include Age or Gender.\n","* The dataset is unreliable, as it was done by a third party.\n","\n","**Data Storage & Privacy:**\n","The dataset is public and under creative commons   [CC0 1.0](http://creativecommons.org/publicdomain/zero/1.0)"]},{"cell_type":"markdown","id":"653a98ef","metadata":{"papermill":{"duration":0.010412,"end_time":"2023-05-18T00:45:48.017409","exception":false,"start_time":"2023-05-18T00:45:48.006997","status":"completed"},"tags":[]},"source":["***“I decided to include a dataset done by Fuller, Harvard Dataverse”; a sample of 46 participants (26 women)wore three devices:***\n","\n","                            GENEActiv -  Apple Watch Series 2 - Fitbit Charge HR2.\n","    Participants completed a 65-minute protocol with 40 minutes of total treadmill time and 25 minutes of sitting or lying time.\n","\n","**Dataset 2** ● [Harvard Dataverse, V1 - Fuller, Daniel, 2020](https://doi.org/10.7910/DVN/ZS2Z2J),  Creative Commons - public domain \"Replication Data for Using Machine Learning methods to predict physical activity types with Apple Watch and Fitbit Data using indirect calorimetry as the Criterion.\"  [CC0 1.0](http://creativecommons.org/publicdomain/zero/1.0)\n","\n","**Dataset 2 Notes:** \n","* The dataset was released in 2020, 4 years before Dataset 1\n","* The dataset includes 46 participants, 26 of them are women.\n","* The dataset is reliable, yet a third party did it.\n","\n","**Data Storage & Privacy:**\n","* The dataset is public and under creative commons   [CC0 1.0](http://creativecommons.org/publicdomain/zero/1.0)"]},{"cell_type":"markdown","id":"467e23b6","metadata":{"papermill":{"duration":0.010139,"end_time":"2023-05-18T00:45:48.038946","exception":false,"start_time":"2023-05-18T00:45:48.028807","status":"completed"},"tags":[]},"source":["# Process & Analyze\n","\n","After scanning and checking data for errors in Excel, I process and analyze data with Excel and visualize it with both Excel Charts and Tableau. Finally, R will be to verify the findings in Excel.\n","\n","Also, the final updated files will be available on both [Google Drive](https://docs.google.com/document/d/e/2PACX-1vQSMYM5zAZ-586ZGcnjSnf-4wp-N9apwrlitIpMTYQuV_Az_AZij2huA_aKG8hd-wGIn2FT-K_pcPK9/pub) and [Github](https://github.com/Ayman-Sabek/GoogleCapstone2023).\n","\n","Data Storage: A cloud folder was created to host cleaned data from both datasets to serve as a master drive for all connected platforms like Rstudio, BigQuery, Tableau, etc."]},{"cell_type":"markdown","id":"50745a1f","metadata":{"papermill":{"duration":0.010065,"end_time":"2023-05-18T00:45:48.059318","exception":false,"start_time":"2023-05-18T00:45:48.049253","status":"completed"},"tags":[]},"source":["**Fitbit Notes** - removed duplications - sorted data - removed unneeded data - separated time and date - Created pivot table to show unique users count and other charts and data - total steps/burned calories chart - Added a day of the week to the activity table. files dropped due to inconsistency\n","\n","**Apple** - convert data of gender to M/F 26 women, 46 participants, (count gender) - Data clean - upper letter table - pivot table - produced charts"]},{"cell_type":"markdown","id":"6f312382","metadata":{"papermill":{"duration":0.010376,"end_time":"2023-05-18T00:45:48.080021","exception":false,"start_time":"2023-05-18T00:45:48.069645","status":"completed"},"tags":[]},"source":["![](https://docs.google.com/drawings/d/sy2IX1jJPlIMyVUrU9-Hsmw/image?parent=e/2PACX-1vQSMYM5zAZ-586ZGcnjSnf-4wp-N9apwrlitIpMTYQuV_Az_AZij2huA_aKG8hd-wGIn2FT-K_pcPK9&rev=79&drawingRevisionAccessToken=RnfGiqdn3jGI9A&h=281&w=450&ac=1)\n","\n","Recommended Storage strategy described below ensures easy access to the latest updated dataset and keeps its consistency.\n","\n","Google Drive \"Always Updated Version\" [avaiable here](https://docs.google.com/document/d/e/2PACX-1vQSMYM5zAZ-586ZGcnjSnf-4wp-N9apwrlitIpMTYQuV_Az_AZij2huA_aKG8hd-wGIn2FT-K_pcPK9/pub)."]},{"cell_type":"markdown","id":"670716ba","metadata":{"papermill":{"duration":0.010931,"end_time":"2023-05-18T00:45:48.101644","exception":false,"start_time":"2023-05-18T00:45:48.090713","status":"completed"},"tags":[]},"source":["**EXCEL**\n","\n","Data extract by inserting a pivot table with an “ID” column, and performing a COUNT formula to count unique participants on cells "]},{"cell_type":"markdown","id":"32fa390d","metadata":{"papermill":{"duration":0.010664,"end_time":"2023-05-18T00:45:48.122584","exception":false,"start_time":"2023-05-18T00:45:48.11192","status":"complet