th More than 16 hours of average sleep or lying.\n","    3. **Introduce an awareness reminder feature within the app that tracks users' sedentary time. It sends regular prompts encouraging them to take breaks, move around, and engage in light physical activity, fostering a more active and healthy lifestyle while minimizing prolonged periods of inactivity.**\n","* Tuesday and Saturday are the Most days calories burned,  while Thursday is the Least.\n","     4. **Develop tailored recommendations and incentives to encourage more consistent physical activity throughout the week, particularly on days like Thursday when calorie burn is lower, aiming to achieve a more balanced and sustained level of calorie expenditure.**\n"]},{"cell_type":"markdown","id":"ad193031","metadata":{"papermill":{"duration":0.017416,"end_time":"2023-05-18T00:46:51.534141","exception":false,"start_time":"2023-05-18T00:46:51.516725","status":"completed"},"tags":[]},"source":["                    .'. THANK YOU FOR THE TIME .'."]},{"cell_type":"markdown","id":"c166269c","metadata":{"papermill":{"duration":0.017522,"end_time":"2023-05-18T00:46:51.569414","exception":false,"start_time":"2023-05-18T00:46:51.551892","status":"completed"},"tags":[]},"source":["Ayman M. Sabek\n","\n","Google Capstone Project - Data Analytics Course\n","\n","May 2023"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":67.76992,"end_time":"2023-05-18T00:46:51.710601","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-05-18T00:45:43.940681","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}